import React from 'react'
import HomeIcon from '@mui/icons-material/Home';
import EditIcon from '@mui/icons-material/Edit';
import HelpIcon from '@mui/icons-material/Help';

export const SidebarData = [
    {
        title: "ホーム",
        icon: <HomeIcon/>,
    },
    {
        title: "エディタ",
        icon: <EditIcon/>,
    },
    {
        title: "ヘルプ",
        icon: <HelpIcon/>,
    },
];
